import React from 'react'

import RoundedButton from '../../../global/buttons/RoundedButton'

import './css/SelectForm.scss'

const SelectForm = (props) => {
    return (
        <>
            <div id='select_form_DIV'>
                <RoundedButton
                    button_CLASSNAME={'blue_ROUNDEDBUTTON medium_ROUNDEDBUTTON'}
                    button_ID={'rentOut_home_BUTTON'}
                    span_CLASSNAME={'p-medium black_TEXT'}
                    button_TEXT={'Rent'}
                    Arrow002={false}
                />
                <RoundedButton
                    button_CLASSNAME={'transparent_ROUNDEDBUTTON medium_ROUNDEDBUTTON'}
                    button_ID={'rentOut_home_BUTTON'}
                    span_CLASSNAME={'p-medium black_TEXT'}
                    button_TEXT={'Rent out'}
                    Arrow002={false}
                />
            </div>
        </>
    )
}

export default SelectForm
